  \"2015-05-07T14:35:25.672351\",\n\t\"name\": \"nasa-image-exchange-nix\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"NASA Technical Reports Server (NTRS) provides
  access to aerospace-related citations, full-text online documents, and images and
  videos. The types of information include: conference papers, journal articles, meeting
  papers, patents, research reports, images, movies, and technical videos u2013 scientific
  and technical information (STI) created or funded by NASA.The NTRS integrates the
  following three NASA collections and enables search and retrieval through a common
  interface:NACA Collection: Citations and reports from the National Advisory Committee
  for Aeronautics period lasting from 1915 to 1958.NASA Collection: Citations and
  documents created or sponsored by NASA starting in 1958 and continuing to the present.NIX
  Collection: Citations and links to the images, photos, movies, and videos from the
  discontinued NASA Image eXchange (NIX).\",\n\t\"license_title\": \"U.S. Government
